import React from "react";
import PropTypes from "prop-types";
// css
import "./Videos.scss";

function Videos(props) {
  return (
    <main className="index">
      <video width={200} height={300}>
        <source src="lambo_gift.mp4" type="video/mp4" />
      </video>
    </main>
  );
}

Videos.propTypes = {};

export default Videos;
